	'messages:apihelp-main-extended-description' => 'uk:<div class="hlist plainlinks api-main-links">
* [[mw:Special:MyLanguage/API:Main_page|Документація]]
* [[mw:Special:MyLanguage/API:Etiquette|Етикет і настанови з використання]]
* [[mw:Special:MyLanguage/API:FAQ|ЧаПи]]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Список розсилки]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ Оголошення API]
* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Баґи і запити]
</div>
<strong>Статус:</strong> Усі функції, вказані на цій сторінці, мають працювати, але API далі перебуває в активній розробці і може змінитися у будь-який момент. Підпишіться на [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ список розсилки mediawiki-api-announce], щоб помічати оновлення.

<strong>Хибні запити:</strong> Коли до API надсилаються хибні запити, буде відіслано HTTP-заголовок з ключем «MediaWiki-API-Error», а тоді і значення заголовку, і код помилки, надіслані назад, будуть встановлені з тим же значенням. Більше інформації див. на сторінці [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Помилки й попередження]].

<p class="mw-apisandbox-link"><strong>Тестування:</strong> Для зручності тестування запитів API, див. [[Special:ApiSandbox]].</p>',
	'messages:apihelp-main-param-action' => 'uk:Яку дію виконати.',
	'messages:apihelp-main-param-format' => 'uk:Формат виводу.',
	'messages:apihelp-main-param-maxlag' => 'uk:Максимальна затримка може використовуватися, коли MediaWiki інстальовано на реплікований кластер бази даних. Щоб зберегти дії, які спричиняють більшу затримку реплікації, цей параметр може змусити клієнт почекати, поки затримка реплікації не буде меншою за вказане значення. У випадку непомірної затримки, видається код помилки <samp>maxlag</samp> з повідомленням на зразок <samp>Очікування на $host: $lag секунд(и) затримки</samp>.<br />Див. [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] для детальнішої інформації.',
	'messages:apihelp-main-param-smaxage' => 'uk:Встановити <code>s-maxage</code> HTTP кеш-контроль заголовок на стільки секунд. Помилки ніколи не кешуються.',
	'messages:apihelp-main-param-maxage' => 'uk:Встановити <code>max-age</code> HTTP кеш-контроль заголовок на стільки секунд. Помилки ніколи не кешуються.',
	'messages:apihelp-main-param-assert' => 'uk:Перевірити, що користувач увійшов у систему (у тому числі, можливо, тимчасовий користувач), якщо задано <kbd>user</kbd>, <em>не</em> увійшов у систему, якщо задано <kbd>anon</kbd>, або має права бота, якщо задано <kbd>bot</kbd>.',
	'messages:apihelp-main-param-assertuser' => 'uk:Перевірити, чи поточний користувач є найменованим користувачем.',
	'messages:apihelp-main-param-requestid' => 'uk:Будь-яке значення, вказане тут, буде включене у відповідь. Може використовуватися, щоб відрізняти запити.',
	'messages:apihelp-main-param-servedby' => 'uk:Включити в результати ім\'я хоста, який обробив запит.',
	'messages:apihelp-main-param-curtimestamp' => 'uk:Включити в результат поточну мітку часу.',
	'messages:apihelp-main-param-responselanginfo' => 'uk:Включати мови, які були використані для <var>uselang</var> і <var>errorlang</var>, у результат.',
	'messages:apihelp-main-param-origin' => 'uk:При доступі до API з використанням крос-доменного AJAX-запиту (CORS), задайте параметру значення вихідного домена. Він має бути включений у будь-який попередній запит і таким чином мусить бути частиною запиту URI (не тіла POST). 

Для автентифікованих запитів він повинен точно збігатися з одним із виходів у заголовку <code>Origin</code>, тобто бути заданим чимось на зразок <kbd>https://uk.wikipedia.org</kbd> або <kbd>https://meta.wikimedia.org</kbd>. Якщо цей параметр не збігається із заголовком <code>Origin</code>, повернеться помилка 403. Якщо цей параметр збігається із заголовком <code>Origin</code> і вихід знаходиться у дозволеному списку, буде встановлено заголовки <code>Access-Control-Allow-Origin</code> і <code>Access-Control-Allow-Credentials</code>.

Для неавтентифікованих запитів укажіть значення <kbd>*</kbd>. Це дасть встановлення заголовка <code>Access-Control-Allow-Origin</code>, але <code>Access-Control-Allow-Credentials</code> буде <code>false</code> і всі дані про користувача будуть заборонені.',
	'messages:apihelp-main-param-uselang' => 'uk:Мова, що використовується для перекладу повідомлень. Список кодів видає <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd>. Ви можете вказати <kbd>user</kbd> на використання поточного налаштування мови користувача, або вказати <kbd>content</kbd> на використання мови вмісту цієї вікі.',
	'messages:apihelp-main-param-variant' => 'uk:Варіант мови. Працює лише, якщо базова мова підтримує конвертацію між варіантами.',
	'messages:apihelp-main-param-errorformat' => 'uk:Формат, що використовується для виведення тексту попередження та помилки',
	'messages:apihelp-main-paramvalue-errorformat-plaintext' => 'uk:Вікітекст із вилученими тегами HTML та заміною сутностей.',
	'messages:apihelp-main-paramvalue-errorformat-wikitext' => 'uk:Нерозбірний вікітекст.',
	'messages:apihelp-main-paramvalue-errorformat-raw' => 'uk:Ключ повідомлення та параметри.',
	'messages:apihelp-main-paramvalue-errorformat-none' => 'uk:Немає тексту, лише коди помилок.',
	'messages:apihelp-main-paramvalue-errorformat-bc' => 'uk:Формат, що використовувався до MediaWiki 1.29. <var>errorlang</var> і <var>errorsuselocal</var> ігноруються.',
	'messages:apihelp-main-param-errorlang' => 'uk:Мова, яку використовувати для попереджень і помилок. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd>  повертає список кодів мов. Вкажіть <kbd>content</kbd>, щоб використати мову вмісту поточної вікі, або <kbd>uselang</kbd>, щоб використовувати те ж значення, що й параметр <var>uselang</var>.',
	'messages:apihelp-main-param-errorsuselocal' => 'uk:Якщо задано, тексти помилок використовуватимуть локальні повідомлення з простору назв {{ns:MediaWiki}}.',
	'messages:apihelp-block-summary' => 'uk:Заблокувати користувача.',
	'messages:apihelp-block-param-user' => 'uk:Користувач, якого слід заблокувати.',
	'messages:apihelp-block-param-userid' => 'uk:Вкажіть <kbd>$1user=#<var>ID</var></kbd> натомість.',
	'messages:apihelp-block-param-expiry' => 'uk:Закінчення часу. Може бути відносним (напр., <kbd>5 місяців</kbd> або <kbd>2 тижні</kbd>) чи абсолютним (напр., <kbd>2014-09-18T12:34:56Z</kbd>). Якщо вказано <kbd>infinite</kbd>, <kbd>indefinite</kbd> або <kbd>never</kbd>, блокування не закінчиться ніколи.',
	'messages:apihelp-block-param-reason' => 'uk:Причина блокування.',
	'messages:apihelp-block-param-anononly' => 'uk:Блокувати тільки анонімних користувачів (тобто відключити можливість анонімних редагувань з цієї IP-адреси, включно з тимчасовими обліковими записами).',
	'messages:apihelp-block-param-nocreate' => 'uk:Заборонити створення облікових записів.',
	'messages:apihelp-block-param-autoblock' => 'uk:Автоматично блокувати IP-адреси, які цей користувач використовував останніми, та будь-які наступні адреси, з яких він спробує зайти в систему.',
	'messages:apihelp-block-param-noemail' => 'uk:Заборонити користувачеві надсилати електронні листи через вікі. (Вимагає права <code>blockemail</code>).',
	'messages:apihelp-block-param-hidename' => 'uk:Приховати ім\'я користувача з журналу блокувань. (Вимагає права <code>hideuser</code>).',
	'messages:apihelp-block-param-allowusertalk' => 'uk:Дозволити користувачу редагувати власну сторінку обговорення (залежить від <var>[[mw:Special:MyLanguage/Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).',
	'messages:apihelp-block-param-reblock' => 'uk:Якщо користувача вже заблоковано одним блокуванням, перезапишіть наявне блокування. Якщо користувача заблоковано більше одного разу, це не вдасться — замість цього використовуйте параметр <var>id</var>, щоб указати, яке блокування потрібно перезаписати.',
