	'messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1' => 'uk:SHA-1 (з основою 16) кожного слоту версії. Якщо вміст версії було приховано з історії, буде повернуто властивість <samp>sha1hidden</samp>.',
