	'messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment' => 'uk:Проаналізований коментар користувача до версії. Якщо коментар до версії було приховано з історії, буде повернуто властивість <samp>commenthidden</samp>.',
	'messages:apihelp-query+revisions+base-paramvalue-prop-content' => 'uk:Вміст кожного слоту версії. Якщо вміст версії було приховано з історії, буде повернуто властивість <samp>texthidden</samp>. З міркувань продуктивності, якщо використовується ця опція, <var>$2limit</var> буде примусово встановлено на $1.',
	'messages:apihelp-query+revisions+base-paramvalue-prop-tags' => 'uk:Мітки версії.',
	'messages:apihelp-query+revisions+base-paramvalue-prop-roles' => 'uk:Перелічити ролі контентних слотів, які існують у версії.',
	'messages:apihelp-query+revisions+base-paramvalue-prop-parsetree' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> або <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>. Синтаксичне дерево XML вмісту версії (передбачає модель вмісту <code>$1</code>). З міркувань продуктивності, якщо використовується ця опція, <var>$3limit</var> буде примусово встановлено на $2.',
	'messages:apihelp-query+revisions+base-param-slots' => 'uk:Для яких слотів версії повернути дані, коли пов\'язані зі слотами властивості зазначені у <var>$1props</var>. Якщо пропущено, буде повернуто дані зі слота <kbd>main</kbd> у зворотно-сумісному форматі.',
	'messages:apihelp-query+revisions+base-param-limit' => 'uk:Обмежити кількість версій, які буде видано. Якщо використано <var>$3prop=content</var>, <var>$3prop=parsetree</var>, <var>$3diffto</var> або <var>$3difftotext</var>, ліміт становить $1. Якщо використано <var>$3parse</var>, ліміт становить $2.',
	'messages:apihelp-query+revisions+base-param-expandtemplates' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd>. Розгорнути шаблони у вмісті версії (передбачає $1prop=content).',
	'messages:apihelp-query+revisions+base-param-generatexml' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> або <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>. Генерувати синтаксичне дерево XML для вмісту версії (передбачає $1prop=content; замінено на <kbd>$1prop=parsetree</kbd>).',
	'messages:apihelp-query+revisions+base-param-parse' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>. Аналізувати вміст версії (передбачає $2prop=content). З міркувань продуктивності, якщо використовується ця опція, <var>$2limit</var> буде примусово встановлено на $1.',
	'messages:apihelp-query+revisions+base-param-section' => 'uk:Витягнути вміст лише розділу з цим ідентифікатором.',
	'messages:apihelp-query+revisions+base-param-diffto' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd>. ID версії, з якою порівняти кожну версію. Використайте <kbd>prev</kbd>, <kbd>next</kbd> і <kbd>cur</kbd> для попередньої, наступної та поточної версій відповідно. З міркувань продуктивності, якщо використовується ця опція, <var>$2limit</var> буде примусово встановлено на $1.',
	'messages:apihelp-query+revisions+base-param-difftotext' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd>. Текст, з яким порівняти кожну версію. Порівнює лише обмежену кількість версій. Перевизначає <var>$2diffto</var>. Якщо вказано <var>$2section</var>, лише ця версія буде порівняна з цим текстом. З міркувань продуктивності, якщо використовується ця опція, <var>$2limit</var> буде примусово встановлено на $1.',
	'messages:apihelp-query+revisions+base-param-difftotextpst' => 'uk:Використовуйте натомість <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd>. Виконати попередню трансформацію тексту перед виведенням дифу. Дійсне лише з використанням <var>$1difftotext</var>.',
	'messages:apihelp-query+revisions+base-param-contentformat' => 'uk:Формат серіалізації, використаний для <var>$1difftotext</var> й очікуваний для контенту-результату.',
