	'messages:api-pageset-param-generator' => 'uk:Отримати список сторінок над якими працювати шляхом виконання вказаного модуля запиту.

<strong>Примітка:</strong> Назви параметрів генератора повинні мати префікс «g», див. приклади.',
	'messages:api-pageset-param-redirects-generator' => 'uk:Автоматично вирішувати перенаправлення у <var>$1titles</var>, <var>$1pageids</var>, і <var>$1revids</var>, та у сторінках, повернених <var>$1generator</var>.',
	'messages:api-pageset-param-redirects-nogenerator' => 'uk:Автоматично вирішувати перенаправлення у <var>$1titles</var>, <var>$1pageids</var>, та <var>$1revids</var>.',
	'messages:api-pageset-param-converttitles' => 'uk:Конвертувати назви в інші варіанти за необхідності. Працює лише для вікі, мова вмісту яких підтримує конвертування варіантів. Мовами, що підтримують конвертування варіантів є $1.',
	'messages:api-help-title' => 'uk:Довідка API MediaWiki',
	'messages:api-help-lead' => 'uk:Це автоматично генерована сторінка документації API MediaWiki.

Документація та приклади: https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page',
	'messages:api-help-main-header' => 'uk:Головний модуль',
	'messages:api-help-undocumented-module' => 'uk:Для модуля $1 відсутня документація.',
	'messages:api-help-flag-deprecated' => 'uk:Цей модуль є застарілим.',
	'messages:api-help-flag-internal' => 'uk:<strong>Цей модуль є внутрішнім або нестабільним, вам не слід його використовувати.</strong> Його робота може бути змінена без сповіщення.',
	'messages:api-help-flag-readrights' => 'uk:Цей модуль вимагає прав на читання.',
	'messages:api-help-flag-writerights' => 'uk:Цей модуль вимагає прав на запис.',
	'messages:api-help-flag-mustbeposted' => 'uk:Цей модуль приймає лише POST-запити.',
	'messages:api-help-flag-generator' => 'uk:Цей модуль може бути використаний як генератор.',
	'messages:api-help-source' => 'uk:Джерело: $1',
	'messages:api-help-source-unknown' => 'uk:Джерело: <span class="apihelp-unknown">невідоме</span>',
	'messages:api-help-license' => 'uk:Ліцензія: [[$1|$2]]',
