	'messages:api-help-parameters' => 'uk:{{PLURAL:$1|Конкретний параметр|Конкретні параметри}}:',
	'messages:api-help-param-deprecated' => 'uk:Застарілий.',
	'messages:api-help-param-deprecated-label' => 'uk:застарілий',
	'messages:api-help-param-internal' => 'uk:Внутрішній.',
	'messages:api-help-param-internal-label' => 'uk:внутрішнє',
	'messages:api-help-param-templated' => 'uk:Це — [[Special:ApiHelp/main#main/templatedparams|шаблонний параметр]].Коли робите запит, $2.',
	'messages:api-help-param-templated-var-first' => 'uk:<var>&#x7B;$1&#x7D;</var> у назві параметра слід замінити значеннями <var>$2</var>',
	'messages:api-help-param-templated-var' => 'uk:<var>&#x7B;$1&#x7D;</var> — значеннями <var>$2</var>',
	'messages:api-help-datatypes-header' => 'uk:Типи даних',
	'messages:api-help-datatypes-top' => 'uk:Введені дані в MediaWiki мають бути в NFC-нормалізованому форматі UTF-8. MediaWiki може зробити спробу конвертувати дані в будь-якому іншому форматі, але це може спричинити невдачу деяких операцій (таких як [[Special:ApiHelp/edit|редагування]] з перевірками MD5).

Параметри, які допускають два і більше значень, зазвичай подаються з цими значеннями, розділеними через вертикальну риску, напр., <kbd>param=значення1|значення2</kbd> або <kbd>param=значення1%7Cзначення2</kbd>. Якщо ж значення повинно містити вертикальну риску, використовуйте U+001F (Unit Separator) як роздільник \'\'та\'\' додавайте до значення префікс U+001F, напр., <kbd>param=%1Fзначення1%1Fзначення2</kbd>.

Деякі типи параметрів у запитах до API потребують додаткових пояснень:',
	'messages:api-help-datatype-boolean' => 'uk:Логічні типи даних працюють як чекбокси з галочками в HTML: якщо параметр вказано, незалежно від значення, то він розцінюється як «true». Для значення «false», уникніть параметра цілковито.',
	'messages:api-help-datatype-expiry' => 'uk:Час може бути відносним (напр.,<kbd>5 months</kbd> чи <kbd>2 weeks</kbd>) або абсолютним (напр., <kbd>2014-09-18T12:34:56Z</kbd>). Щоб спостерігати за сторінкою безстроково, використовуйте <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, чи <kbd>never</kbd>.',
	'messages:api-help-datatype-timestamp' => 'uk:Мітки часу можна вказувати в різних форматах, див. [[mw:Special:MyLanguage/Timestamp|формати вводу з бібліотеки міток часу, задокументовані на mediawiki.org]], щоб дізнатись більше. Рекомендовано використовувати дату й час у форматі ISO 8601: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Додатково можна використати рядок <kbd>now</kbd> для вказання поточної мітки часу.',
	'messages:api-help-templatedparams-header' => 'uk:Шаблонні параметри',
	'messages:api-help-templatedparams' => 'uk:Шаблонні параметри підтримують випадки, в яких модулю API необхідне значення для кожного значення якогось іншого параметра. Наприклад, якби був модуль API для запитів фруктів, у нього був би параметр <var>fruits</var> для зазначення, запит на які саме фрукти надсилається і шаблонний параметр <var>{fruit}-quantity</var> для зазначення, скільки саме кожного різновиду фруктів потрібно. Клієнт API, якому потрібні 1 яблуко, 5 бананів і 20 полуниць, таким чином, міг би надіслати запит у формі <kbd>fruits=apples|bananas|strawberries&apples-quantity=1&bananas-quantity=5&strawberries-quantity=20</kbd>.',
	'messages:api-help-param-type-expiry' => 'uk:Тип: {{PLURAL:$1|1=втрата актуальності|2=список втрат актуальності}} ([[Special:ApiHelp/main#main/datatype/expiry|подробиці]])',
	'messages:api-help-param-type-limit' => 'uk:Тип: ціле число або <kbd>max</kbd>',
	'messages:api-help-param-type-presenceboolean' => 'uk:Тип: логічний ([[Special:ApiHelp/main#main/datatype/boolean|подробиці]])',
	'messages:api-help-param-type-timestamp' => 'uk:Тип: {{PLURAL:$1|1=часова мітка|2=список часових міток}} ([[Special:ApiHelp/main#main/datatype/timestamp|дозволені формати]])',
	'messages:api-help-param-type-enum' => 'uk:{{PLURAL:$1|1=Одне з наступних значень|2=Значення (розділені через <kbd>{{!}}</kbd> або [[Special:ApiHelp/main#main/datatypes|альтернативу]])}}: $2',
	'messages:api-help-param-multi-separate' => 'uk:Розділіть значення з допомогою <kbd>|</kbd> або [[Special:ApiHelp/main#main/datatypes|альтернативу]].',
	'messages:api-help-param-multi-all' => 'uk:Щоб зазначити всі значення, використовуйте <kbd>$1</kbd>.',
	'messages:api-help-param-default-empty' => 'uk:За замовчуванням: <span class="apihelp-empty">(порожньо)</span>',
	'messages:api-help-param-token' => 'uk:Токен «$1» отримано з [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]',
	'messages:api-help-param-token-webui' => 'uk:Для сумісності, приймається також токен, використаний у користувацькому веб-інтерфейсі.',
	'messages:api-help-param-disabled-in-miser-mode' => 'uk:Вимкнено через [[mw:Special:MyLanguage/Manual:$wgMiserMode|скупий режим]].',
	'messages:api-help-param-limited-in-miser-mode' => 'uk:<strong>Примітка:</strong> через [[mw:Special:MyLanguage/Manual:$wgMiserMode|«скупий режим»]], використання цього може вилитися у видачу результатів менше ніж <var>$1limit</var> перед продовженням; в особливих випадках можуть видаватися нульові результати.',
	'messages:api-help-param-direction' => 'uk:У якому напрямку перелічувати:',
	'messages:api-help-paramvalue-direction-newer' => 'uk:Спочатку найстарші. Примітка: $1start має бути перед $1end.',
	'messages:api-help-paramvalue-direction-older' => 'uk:Спочатку найновіші (за замовчуванням). Примітка: $1start має бути перед $1end.',
	'messages:api-help-param-continue' => 'uk:Коли буде доступно більше результатів, використовуйте це, щоб продовжити. Більш детальну інформацію про те, як продовжувати запити, [[mw:Special:MyLanguage/API:Continue|можна знайти на mediawiki.org]].',
	'messages:api-help-param-no-description' => 'uk:<span class="apihelp-empty">(без опису)</span>',
	'messages:api-help-examples' => 'uk:{{PLURAL:$1|Приклад|Приклади}}:',
	'messages:api-help-permissions' => 'uk:{{PLURAL:$1|Дозвіл|Дозволи}}:',
	'messages:api-help-permissions-granted-to' => 'uk:{{PLURAL:$1|Надано|Надані}}: $2',
	'messages:api-help-right-apihighlimits' => 'uk:Використовувати вищі ліміти у запитах API (повільні запити: $1; швидкі запити: $2). Ліміти для повільних запитів також застосовуються до багатозначних параметрів.',
	'messages:api-help-open-in-apisandbox' => 'uk:<small>[відкрити в пісочниці]</small>',
	'messages:api-help-authmanager-general-usage' => 'uk:Загальна процедура використання цього модуля така:
# Отримайте доступні поля зі <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> за допомогою <kbd>amirequestsfor=$4</kbd>, а також токен <kbd>$5</kbd> зі <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.
# Передайте ці поля користувачеві, і отримайте інформацію, якою він їх заповнить.
# Напишіть до цього модуля, заповнивши <var>$1returnurl</var> та всі релевантні поля.
# Перевірте <samp>status</samp> у відповіді.
#* Якщо Ви отримали <samp>PASS</samp> або <samp>FAIL</samp>, роботу завершено. Операція або була успішною, або провалилася.
#* Якщо Ви отримали <samp>UI</samp>, надішліть нові поля користувачеві й отримайте інформацію, якою він їх заповнить. Далі напишіть до цього модуля із <var>$1continue</var> та заповніть всі реелевантні поля, після чого повторіть крок 4.
#* Якщо Ви отримали <samp>REDIRECT</samp>, направте користувача до <samp>redirecttarget</samp> і дочекайтеся повернення до <var>$1returnurl</var>. Тоді напишіть до цього модуля із <var>$1continue</var>, та з усіма полями, що були передані до повернутої URL-адреси, після чого повторіть крок 4.
#* Якщо Ви отримали <samp>RESTART</samp>, це означає, що автентифікація спрацювала, але ми не маємо пов\'язаного облікового запису користувача. Ви можете розцінити це як <samp>UI</samp>, або як <samp>FAIL</samp>.',
	'messages:api-help-authmanagerhelper-requests' => 'uk:Використовувати ці автентифікаційні запити через <samp>id</samp>, що повертається з <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> за допомогою <kbd>amirequestsfor=$1</kbd>, або з попередньої відповіді з цього модуля.',
	'messages:api-help-authmanagerhelper-request' => 'uk:Використовувати цей автентифікаційний запит через <samp>id</samp>, що повертається з <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> за допомогою <kbd>amirequestsfor=$1</kbd>.',
	'messages:api-help-authmanagerhelper-messageformat' => 'uk:Формат до використання для повернення повідомлень.',
	'messages:api-help-authmanagerhelper-mergerequestfields' => 'uk:Об\'єднати інформацію всіх автентифікаційних запитів у один масив.',
	'messages:api-help-authmanagerhelper-preservestate' => 'uk:Зберегти статус з попередньої спроби входу, що не вдалась, якщо можливо.',
	'messages:api-help-authmanagerhelper-returnurl' => 'uk:URL-адреса повернення для сторонніх автентифікаційних потоків повинна бути абсолютною. Обов\'язковим є це, або <var>$1continue</var>. 

При отриманні відповіді <samp>REDIRECT</samp>, найбільш звичною Вашою дією буде відкриття браузерного чи іншого веб-перегляду вказаного URL-посилання для стороннього потоку автентифікації. Коли ця операція буде завершена, стороння програма перенаправить веб-переглядач на цю URL-адресу. Ви повинні видобувати будь-які параметри запитів або POST-параметри із цієї URL-адреси, і передавати їх як запит <var>$1continue</var> до цього модуля API.',
	'messages:api-help-authmanagerhelper-continue' => 'uk:Цей запит є продовженням після попередньої відповіді <samp>UI</samp> або <samp>REDIRECT</samp>. Або це, або <var>$1returnurl</var> є обов\'язковим.',
	'messages:api-help-authmanagerhelper-additional-params' => 'uk:Цей модуль приймає додаткові параметри, залежно від доступних автентифікаційних запитів. Використовуйте <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> за допомогою <kbd>amirequestsfor=$1</kbd> (або попередню відповідь від цього модуля, якщо це застосовно), аби визначити доступні запити та поля, які вони використовують.',
	'messages:apierror-allimages-redirect' => 'uk:Використовуйте <kbd>gaifilterredir=nonredirects</kbd> замість <var>redirects</var> при використанні <kbd>allimages</kbd> як генератора.',
	'messages:apierror-allpages-generator-redirects' => 'uk:Використовуйте <kbd>gapfilterredir=nonredirects</kbd> замість <var>redirects</var> при використанні <kbd>allpages</kbd> як генератора.',
	'messages:apierror-alreadyregistered' => 'uk:У вас вже є обліковий запис користувача.',
	'messages:apierror-appendnotsupported' => 'uk:Не вдається додавати до сторінок, що використовують контентну модель $1.',
	'messages:apierror-articleexists' => 'uk:Сторінку, яку ви намагалися створити, вже було створено.',
	'messages:apierror-assertanonfailed' => 'uk:Ви вже перебуваєте в системі, тож дію неможливо завершити.',
	'messages:apierror-assertbotfailed' => 'uk:У вас немає права <code>bot</code>, тож дію неможливо завершити.',
	'messages:apierror-assertnameduserfailed' => 'uk:Ви вже не перебуваєте в системі як «$1», тож дію неможливо завершити.',
	'messages:apierror-assertuserfailed' => 'uk:Ви вже не перебуваєте в системі, тож дію неможливо завершити.',
	'messages:apierror-autoblocked' => 'uk:Вашу IP-адресу було автоматично заблоковано, оскільки її використовував заблокований користувач.',
	'messages:apierror-bad-badfilecontexttitle' => 'uk:Недійсна назва в параметрі <var>$1badfilecontexttitle</var>.',
	'messages:apierror-badconfig-resulttoosmall' => 'uk:Значення <code>$wgAPIMaxResultSize</code> у цій вікі є надто малим, щоб містити базову інформацію щодо результатів.',
	'messages:apierror-badcontinue' => 'uk:Параметр продовження недійсний. Вам треба вказати початкове значення, отримане з попереднього запиту.',
	'messages:apierror-baddiff' => 'uk:Цю різницю версій неможливо відтворити: одна або й обидві версії не існують, або Ви не маєте прав на їх перегляд.',
	'messages:apierror-baddiffto' => 'uk:Для <var>$1diffto</var> треба задати невід\'ємне число,<kbd>prev</kbd>, <kbd>next</kbd> або <kbd>cur</kbd>.',
	'messages:apierror-badformat-generic' => 'uk:Запитуваний формат $1 не підтримується контентною моделлю $2.',
	'messages:apierror-badformat' => 'uk:Запитуваний формат $1 не підтримується контентною моделлю $2, що використовується $3.',
