	'messages:apierror-badmd5' => 'uk:Вказаний хеш MD5 був неправильним.',
	'messages:apierror-badmodule-badsubmodule' => 'uk:Модуль <kbd>$1</kbd> не має підмодуля «$2».',
	'messages:apierror-badmodule-nosubmodules' => 'uk:Модуль <kbd>$1</kbd> не має підмодулів.',
	'messages:apierror-badparameter' => 'uk:Недійсне значення для параметра <var>$1</var>.',
	'messages:apierror-badquery' => 'uk:Неприпустимий запит.',
	'messages:apierror-badtimestamp' => 'uk:Недійсне значення «$2» для параметра мітки часу <var>$1</var>.',
	'messages:apierror-badtoken' => 'uk:Недійсний токен CSRF.',
	'messages:apierror-badupload' => 'uk:Параметр завантаження файлу <var>$1</var> не є завантаженням файлу; не забудьте використати <code>multipart/form-data</code> для Вашого POST і додайте назву файлу в шапку <code>Content-Disposition</code>.',
	'messages:apierror-badurl' => 'uk:Недійсне значення «$2» для URL-параметра <var>$1</var>.',
	'messages:apierror-baduser' => 'uk:Недійсне значення «$2» для параметра користувача <var>$1</var>.',
	'messages:apierror-badvalue-notmultivalue' => 'uk:Відокремлення значень через U+001F може використовуватись лише в тих параметрах, де використання двох і більше значень є прийнятним.',
	'messages:apierror-bad-watchlist-token' => 'uk:Надано некоректний токен списку спостереження. Будь ласка, подайте коректний токен на сторінці [[Special:Preferences|Спеціальна:Налаштування]].',
	'messages:apierror-blockedfrommail' => 'uk:Вам заблоковано можливість надсилання електронної пошти.',
	'messages:apierror-blocked' => 'uk:Вам заблоковано можливість редагування.',
