	'messages:config-pingback' => 'uk:Поділитися даними про цю інсталяцію з розробниками MediaWiki. [https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement Політика конфіденційності].',
	'messages:config-pingback-help' => 'uk:Якщо Ви обираєте цю опцію, MediaWiki періодично пінгуватиме https://www.mediawiki.org базовими даними про цю інсталяцію MediaWiki. Дані включають, наприклад, тип системи, версію PHP, обраний бекенд бази даних. Фонд Вікімедіа ділиться цими даними з розробниками MediaWiki, щоб допомогти спрямувати подальші розробки. Від Вашої системи надсилатимуться такі дані:
<pre>$1</pre>

Політику конфіденційності для цієї функції можна переглянути на https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.

Іншу загальну інформацію про цю функцію див. на https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.

Агеговані pingback-дані див. на https://pingback.wmcloud.org/.',
