	'messages:config-profile' => 'uk:Профіль прав користувача:',
	'messages:config-profile-wiki' => 'uk:Відкрита вікі',
	'messages:config-profile-no-anon' => 'uk:Необхідно створити обліковий запис',
	'messages:config-profile-fishbowl' => 'uk:Тільки для авторизованих редакторів',
	'messages:config-profile-private' => 'uk:Приватна вікі',
	'messages:config-profile-help' => 'uk:Вікі краще працюють, коли Ви дозволяєте їх редагувати якомога ширшому колу людей.
У MediaWiki легко переглядати останні зміни і відкочувати будь-яку шкоду, спричинену недосвідченими або зловмисними користувачами.

Одначе, MediaWiki може бути корисна по-різному, й інколи важко переконати у вигідності відкритої вікі-роботи.
Тож у Вас є вибір.

Модель \'\'\'{{int:config-profile-wiki}}\'\'\' дозволяє редагувати будь-кому, навіть без входження в систему.
Вікі з вимогою "\'\'\'{{int:config-profile-no-anon}}\'\'\'" дає певний облік, але може відвернути випадкових дописувачів.
Спосіб "\'\'\'{{int:config-profile-fishbowl}}\'\'\'" дозволяє редагувати підтвердженим користувачам, а переглядати сторінки і історію можуть усі.
\'\'\'{{int:config-profile-private}}\'\'\' дозволяє переглядати сторінки і редагувати лише підтвердженим користувачам.

Детальніші конфігурації прав користувачів доступні після встановлення, див. [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights відповідний розділ посібника].',
	'messages:config-license' => 'uk:Авторські права і ліцензія:',
	'messages:config-license-none' => 'uk:Без ліцензії у нижньому колонтитулі',
