	'messages:config-license-cc-by' => 'uk:Creative Commons Attribution',
	'messages:config-license-cc-by-nc-sa' => 'uk:Creative Commons Attribution Non-Commercial Share Alike',
	'messages:config-license-cc-0' => 'uk:Creative Commons Zero (Суспільне надбання)',
	'messages:config-license-gfdl' => 'uk:GNU Free Documentation License 1.3 або пізніша',
	'messages:config-license-pd' => 'uk:Суспільне надбання (Public Domain)',
	'messages:config-license-help' => 'uk:Чимало загальнодоступних вікі публікують увесь свій вміст під [https://freedomdefined.org/Definition вільною ліцензією]. Це розвиває відчуття спільної власності і заохочує довготривалу участь. У загальному випадку для приватної чи корпоративної вікі у цьому немає необхідності.

Якщо Ви хочете мати змогу використовувати текст з Вікіпедії і дати Вікіпедії змогу використовувати текст, скопійований з Вашої вікі, вам необхідно обрати <strong>{{int:config-license-cc-by-sa}}</strong>.

Раніше Вікіпедія використовувала GNU Free Documentation License.
GFDL — допустима ліцензія, але у ній важко розібратися, а контент під GFDL важко використовувати повторно.',
