	'messages:managewiki-header-core' => 'uk:Ви можете керувати кореневими налаштуваннями цієї вікі (такими як назва та мова) з цієї панелі. Опції, виділені сірим кольором, можуть змінювати лише оператори ферми. Коли завершите, натисніть «Зберегти», і ваші налаштування відобразяться через кілька секунд.

Ви можете керувати додатковими параметрами, такими як логотип тощо, на [[Special:ManageWiki/settings]].',
	'messages:managewiki-header-extensions' => 'uk:Ви можете керувати розширеннями та темами оформлення цієї вікі з цієї панелі. Ця панель показує всі доступні розширення та теми. Якщо ви не бачите потрібного розширення або теми, зверніться до свого системного адміністратора.

Після завершення натисніть «Зберегти», і ваше розширення або тему буде встановлено за кілька секунд.',
	'messages:managewiki-header-namespaces' => 'uk:Ви можете керувати налаштуваннями просторів назв цієї вікі з цієї панелі. Деякі налаштування відобразяться лише після ввімкнення розширення. Для отримання додаткової інформації ознайомтеся з документацією MediaWiki. Закінчивши, натисніть «Зберегти», і ваші налаштування відобразяться через кілька секунд.',
	'messages:managewiki-header-permissions' => 'uk:Ви можете керувати налаштуваннями груп користувачів цієї вікі з цієї панелі (такими як дозволи, призначення груп і автоматичне долучення). Будь ласка, уважно прочитайте документацію та не видаляйте групи бездумно, інакше ваша вікі може зламатись. Після завершення натисніть «Зберегти», і ваші налаштування відобразяться через кілька секунд.

Не всі дозволи можна призначити. Деякі дозволи користувача можуть бути зарезервовані лише для операторів ферми. Зверніться до своєї ферми, якщо ви не знаходите певних дозволів.',
	'messages:managewiki-header-settings' => 'uk:Ви можете керувати налаштуваннями цієї вікі (такими як логотип, стиль тощо) з цієї панелі. Будьте обережні! Уважно прочитайте опис налаштувань і не перемикайте випадкові налаштування без розбору, якщо ви не розумієте, що вони роблять. Після завершення натисніть «Зберегти», і ваші параметри відобразяться через кілька секунд. 

Неактивні опції можуть бути змінені лише операторами ферми. Ви можете керувати основними налаштуваннями, такими як назва вікі та мова, на [[Special:ManageWiki/core]].',
